import { AnalyticsDashboard,useDataChart } from "react-analytics-charts";
import {
  SessionsByDateChart,
  SessionsGeoChart,
} from "react-analytics-charts";
import {DataChart} from './DataChart'

function App() {
  return (
    <div style={{ color:"white" }}>
    <AnalyticsDashboard
      authOptions={{
        clientId:
          "798387791418-1q56un70liaijau2sgl16014b4rdhoq2.apps.googleusercontent.com",
      }}
      renderCharts={(gapi, viewId) => {
        const chartStyles = {
          maxWidth: 600,

        };
        return (
          <div >
            <SessionsByDateChart
              gapi={gapi}
              viewId={viewId}
              showPageViews
              showUsers
              style={chartStyles}
            />
            <SessionsGeoChart gapi={gapi} viewId={viewId} style={chartStyles} showPageViews />

          </div>
        );
      }}
    />
    </div>
  );
}

export default App;
